import Vue from 'vue';
import VueRouter from 'vue-router';
import ViewUI from 'view-design';
import store from '../store/index';
Vue.use(ViewUI);
Vue.use(VueRouter);
/**
 * 在本次项目路由配置中，开始启用 `静态路由` 和 `动态路由` 两部分
 * 思路：
 * 前提：本地存储两部分路由数据 一个是静态路由配置staticRoutes，另一个是动态路由配置asyncRoutes 所有
 * 1、登录返回token
 * 2、根据token获取用户信息（包含用户角色可用的菜单数据）
 * 3、一方面直接渲染菜单数据，根据asyncRoutes筛选出可使用的路由配置
 * 4、利用vueRouter.addRouters()，添加路由
 * PS：
 * 1、如果路由中有关于*路由匹配的404组件，需要放到最后，因为系统会顺序查找路由，在前面会直接进入404
 * 2、在某些异常情况下，如刷新页面，可能会导致异步路由数据丢失，解决方案是将异步路由数据在本地缓存，遇到时在细说
 */
// 静态路由
export const staticRoutes = [
    {
        path: '/login',
        name: 'login',
        component: () => import('@/views/login/login.vue'),
        meta: { title: '登录' },
    },
    {
        path: '/',
        name: 'layout',
        redirect: '/search',
        meta: { title: '主页' },
        component: () => import('../views/layout.vue'),
        children: [
            {
                path: 'dashboard',
                name: 'dashboard',
                meta: { title: '数据面板' },
                component: () => import('../views/dashboard/index.vue'),
                children: [],
            },
            {
                path: 'search',
                name: 'search',
                meta: { title: '日志查询' },
                component: () => import('../views/search/search.vue'),
                children: [],
            },
            {
                path: 'analysis',
                name: 'analysis',
                meta: { title: '行为分析' },
                component: () => import('../views/analysis/analysis.vue'),
                children: [],
            },
            {
                path: 'collect',
                name: 'collect',
                redirect: '/collect/in-task',
                meta: { title: '入库与导出' },
                component: () => import('../views/collect/collect.vue'),
                children: [
                    {
                        path: 'in-task',
                        name: 'in-task',
                        meta: { title: '入库任务' },
                        component: () =>
                            import('../views/collect/inTask/in-task.vue'),
                    },
                    {
                        path: 'out-task',
                        name: 'out-task',
                        meta: { title: '导出任务' },
                        component: () =>
                            import('../views/collect/outTask/out-task.vue'),
                    },
                ],
            },
            {
                path: 'setting',
                name: 'setting',
                meta: { title: '系统设置' },
                redirect: '/setting/unit',
                component: () => import('../views/setting/setting.vue'),
                children: [
                    {
                        path: 'unit',
                        name: 'unit',
                        meta: { title: '单位管理' },
                        component: () =>
                            import('../views/setting/unit/unit.vue'),
                    },
                    // {
                    //     path: 'user',
                    //     name: 'user',
                    //     meta: { title: '用户管理' },
                    //     component: () =>
                    //         import('../views/setting/user/user.vue'),
                    // },
                    // {
                    //     path: 'role',
                    //     name: 'role',
                    //     meta: { title: '角色管理' },
                    //     component: () =>
                    //         import('../views/setting/role/role.vue'),
                    // },
                    // {
                    //     path: 'might',
                    //     name: 'might',
                    //     meta: { title: '权限管理' },
                    //     component: () =>
                    //         import('../views/setting/might/might.vue'),
                    // },
                ],
            },
            {
                path: '/operation',
                name: 'operation',
                redirect: '/operation/regular',
                title: { title: '运维管理' },
                component: () => import('../views/operation/operation.vue'),
                children: [
                    {
                        path: 'regular',
                        name: 'regular',
                        meta: { title: '基本正则' },
                        component: () =>
                            import('../views/operation/regular/regular.vue'),
                    },
                    {
                        path: 'in-func',
                        name: 'in-func',
                        meta: { title: '内置函数' },
                        component: () =>
                            import('../views/operation/in-func/in-func.vue'),
                    },
                    {
                        path: 'groke',
                        name: 'groke',
                        meta: { title: 'groke管理' },
                        component: () =>
                            import('../views/operation/groke/groke.vue'),
                    },
                    {
                        path: 'expression',
                        name: 'expression',
                        meta: { title: '表达式测试' },
                        component: () =>
                            import(
                                '../views/operation/expression/expression.vue'
                            ),
                    },
                ],
            },
        ],
    },
];
// 动态路由
export const asyncRoutes = [];

const router = new VueRouter({
    // 模式 hash（带#） 还是 history（不带#，需要后台做配置）
    mode: 'hash',
    // Vue Router的切换路由后的页面滚动行为，可实现切换路由后滚动到相应位置，在这滚动到顶部，更多详细查看Vue Router官网进阶篇滚动行为
    scrollBehavior: () => {
        return { y: 0 };
    },
    routes: staticRoutes,
});

ViewUI.LoadingBar.config({
    color: '#5cb85c',
    failedColor: '#f0ad4e',
    height: 5,
});

const defaultPage = 'search';
const loginPage = 'login';

// 路由拦截
router.beforeEach((to, from, next) => {
    ViewUI.LoadingBar.start();
    // 设置页面title
    document.title = to.meta.title + ' - 日志收集与分析系统';
    let token = store.state.token;
    // 如果有token
    if (token) {
        if (to.path === '/login') {
            // 如果已登录，重定向到主页
            next({ name: defaultPage });
            // 停止加载进度条
            ViewUI.LoadingBar.finish();
        } else {
            next();
        }
    } else {
        if (to.path === '/login') {
            next();
        } else {
            next({ name: loginPage });
        }
    }
});

router.afterEach(() => {
    ViewUI.LoadingBar.finish();
});

// 解决路由重复点击报错问题 解决跳转同一个路由报错
/**
 * 报错信息：
 * Uncaught (in promise) NavigationDuplicated: Avoided redundant navigation to current location: "".
 */
const originalPush = VueRouter.prototype.push;
VueRouter.prototype.push = function push(location) {
    return originalPush.call(this, location).catch((err) => err);
};

export default router;
